INSERT INTO "public"."dishes" ("dish_id", "menu_section_id", "dish_name", "total_time", "serving_size", "cooking_notes", "serving_unit_id", "serving_item", "directions", "num_servings", "kitchen_id", "created_at", "updated_at", "image_updated_at") VALUES
	('412dc85f-1d16-463e-9de1-59d1317193fe', 'f195b1a3-91c7-48b0-b5b4-63cead27976e', 'Spaghetti Pomodoro e basilico', '00:20:00', 90, NULL, 'd60e4ba8-d2b7-45af-ae48-1154b2dacc08', NULL, '{"Mettere l''acqua a bollire.","Schiacciare 2 spicchi di aglio.","Aggiungere 3 cucchiai di olio quando l''olio è bollente.","Aggiungere il pomodoro.","Mettere gli spaghetti nell''acqua (11 minuti).","Aggiungere il basilico nel pomodoro (tritato o intero).","Quando è lista e cotta il sugo è pronto.","Mescolare con mezzo mestolo di acqua della pasta e un po'' di burro."}', 1, 'b6fac464-1cb7-4474-b109-917fa33d5d54', '2025-07-12 13:17:52.825793+00', '2025-07-12 13:18:18.481483+00', '2025-07-12 13:18:18.380561+00'),
	('a466ddc5-4cc3-4bb3-aea9-b60df3ee2346', NULL, 'Chocolate Tart', '00:30:00', 100, NULL, 'd60e4ba8-d2b7-45af-ae48-1154b2dacc08', NULL, NULL, 1, 'bdc44a77-6aaf-4039-bb52-d853fdff2364', '2025-08-03 17:49:40.916354+00', '2025-08-03 17:49:40.916354+00', NULL),
	('046cf913-50c9-43b8-b2d8-ff483fffa7a6', NULL, 'H. Mató', '00:30:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Preparar la mezcla según las instrucciones anteriores."}', 1, 'dc9ed5aa-54c9-4df5-b9a4-959e71a39ef8', '2025-07-10 17:03:06.047304+00', '2025-07-10 17:05:57.680839+00', '2025-07-10 17:04:03.497378+00'),
	('c71a2128-59a7-4e9e-8ae3-6a51e7f2234f', 'a1f49f4f-80a6-423b-91d0-ed01bd478d17', 'Korean Ssamjang Dip', '00:10:00', 1, 'You can serve this dip with raw vegetables or use it as a dip for Korean-style steamed dishes.', '3190b927-4f0a-4bab-bf06-00df3026fd22', NULL, '{"In a blender, combine the jalapeño, gochujang, doenjang or white miso paste, garlic, scallions, soy sauce, sesame oil, rice vinegar, and sugar (if using). Blend until smooth.","Taste and adjust the seasoning as needed.","Serve with raw vegetables."}', 1, '2ab0aeb0-c8e9-4df9-b32b-7a10dd18dbb6', '2025-07-24 11:23:48.510377+00', '2025-07-24 11:30:31.426618+00', NULL),
	('867e34f8-3673-4360-aa53-4e688090017a', '8838f9c3-ad70-4547-9f23-8ec7db1fce46', 'Leek, Leek', '01:30:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Serve poached leek with leek sauce and cauliflower foam."}', 1, '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-07-23 14:56:17.584247+00', '2025-08-04 08:23:46.431674+00', NULL),
	('ba462224-d3f6-4d91-922a-327a53207132', NULL, 'Roasted Butternut Squash Soup', '00:40:00', 250, 'Save all leftover peels and trimmings from the carrots, onion, and garlic for later use.', '5ed92eb3-c2b8-4063-a88c-42373f632c1c', NULL, '{"Preheat the oven to 200°C (392°F).","Cut the butternut squash in half lengthwise, remove the seeds (set them aside for later), and roast skin side down.","Peel and chop carrots, onion, and garlic.","Drizzle olive oil, season with salt and pepper, and roast veggies for 45-50 minutes.","Dice a portion of roasted butternut squash for Butternut Squash Risotto & save for recipe 7.","Roast leftover butternut squash seeds for 10-15 minutes.","Blend roasted vegetables until smooth, adjusting consistency with broth or water.","Heat soup in a pot, season to taste, and serve hot with roasted seeds and olive oil garnish."}', 1, '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-07-09 15:08:40.543797+00', '2025-07-12 22:25:46.798778+00', '2025-07-12 22:25:46.765772+00'),
	('3e0ca4d0-ccf2-4bc4-934f-b632c2381860', NULL, 'Tuna Ratatouille', '00:30:00', 250, NULL, 'd60e4ba8-d2b7-45af-ae48-1154b2dacc08', NULL, '{"Fry the aubergines and onions until caramelised.","Separate from the pan.","Fry red pepper - separate.","Fry courgette until all the water has gone - should be browned.","Bring everything together in the same pan, add herbs and cook with tomato puree.","When everything is integrated, add the tuna and leave to simmer - covered.","Add fresh basil and serve on a bed of rice."}', 1, '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-07-16 15:59:46.692832+00', '2025-07-18 08:35:17.238728+00', '2025-07-16 16:00:18.446075+00'),
	('57159ab4-f635-4158-afb9-18a7854fa0a3', 'e9248f49-a61a-4c38-a693-ee0e08fb8442', 'Crispy Fish Sticks with Mushy Peas', '00:30:00', 4, 'Ensure fish sticks are golden and crispy.', '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Serve crispy fish sticks with mushy peas."}', 1, 'ff3f850e-a473-43d9-9520-a9959be26dbd', '2025-07-11 10:53:04.228393+00', '2025-07-11 10:54:19.035536+00', '2025-07-11 10:53:49.102491+00'),
	('76d10c78-8ee0-4998-a849-530a834a8a5b', '5dbb7c46-0a8a-48c7-9ae4-acc25f47da80', 'Leek, Leek', '01:00:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', 'leek', '{"Poach the leeks in white stock and miso until soft.","Make cauliflower foam by cooking cauliflower in butter, blending with cream, and straining.","Prepare leaf sauce by boiling green stems from leek in water, blending, and reducing.","Serve poached leeks with cauliflower foam and leaf sauce."}', 1, '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-07-09 15:06:55.579716+00', '2025-08-01 13:22:05.620759+00', '2025-07-19 20:13:04.356626+00'),
	('f9c8c0a2-f754-4dd8-9a37-73a7157930e5', NULL, 'Tartas saladas de tarín', '00:15:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Preheat the oven to 180 degrees.","Prepare the ingredients: cherry tomatoes, olive oil, balsamic vinegar, Italian spice mix, puff pastry, burrata, basil.","Bake the tart for 15 minutes.","Assemble the tart with the prepared ingredients."}', 1, '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-07-11 18:42:55.276421+00', '2025-07-18 08:35:20.131339+00', '2025-07-11 18:43:53.156017+00'),
	('0d16c807-a8eb-4cc6-ae5a-05f5660dbb45', NULL, 'Cauliflower Shepherd''s Pie', '00:50:00', 1, 'Vegan and Vegetarian: Use cooked lentils instead of ground meat.', '0715a344-20c6-4caf-b353-f08503930af5', 'serving', '{"Preheat oven to 350°F (177°C).","Transfer the meat mixture to a casserole or pie dish and distribute into an even layer.","Top with the cauliflower mash and spread it evenly across the top.","Place in the oven and bake for 20 minutes.","Turn the oven to a low broil and broil for 10 minutes or until golden.","Remove from oven and serve."}', 1, '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-07-09 17:58:46.731631+00', '2025-07-18 09:51:35.66986+00', NULL),
	('16e22247-3123-4861-9070-be06f7b08736', '617d1790-567e-4499-816e-4f38907279ab', 'Smashed Cucumber Salad', '01:00:00', 1, 'Let the salad sit in the fridge for at least an hour before eating.', '0715a344-20c6-4caf-b353-f08503930af5', 'serving', '{"Let the salad sit in the fridge for at least an hour before eating.","Sprinkle the coriander leaves on top and serve."}', 1, '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-07-23 08:18:17.021486+00', '2025-07-23 08:18:17.021486+00', NULL),
	('edf4e27d-db63-4dcf-9d95-af4df6ddaf20', '8838f9c3-ad70-4547-9f23-8ec7db1fce46', 'Leau, leau', '01:30:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Serve the poached leau with leau sauce and cauliflower foam."}', 1, '2010da74-6360-44c5-9b63-db0cd17a6530', '2025-07-23 08:16:05.838753+00', '2025-07-23 14:36:02.568172+00', '2025-07-23 08:17:17.666084+00'),
	('74c79adc-1130-4e88-a8e1-5900dac84be7', '41526fa4-7646-4001-8641-7d33269afac1', 'Tiramisù', '02:30:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Once ready, get a generous spoon of cream for the base of your tiramisù in a baking dish size around 30x20 cm.","Soak for few seconds the savoiardi biscuits both sides into the coffee already cold and sweetened as you prefer.","Distribute the soaked savoiardi on the top of the cream, all in the same direction and level.","Add again on the top the cream, then the savoiardi and keep going on the same till you will made the layers that you like.","Give more attention on the last layer of cream, since will be the presentation of your tiramisù.","Put on the top the bitter cocoa powder.","Put the tiramisù in the fridge for at least a couple of hours."}', 1, '816f8fdb-fedd-4e6e-899b-9c98513e49c5', '2025-07-09 02:13:37.763633+00', '2025-08-01 18:38:51.598359+00', '2025-08-01 18:38:51.502654+00'),
	('8ee812fc-f52f-488d-98d0-af4b1fea16d3', NULL, 'Eclair Tiramisú', '02:00:00', 1, NULL, '0715a344-20c6-4caf-b353-f08503930af5', NULL, '{"Prepare choux pastry and pipe into éclairs.","Bake until golden.","Fill with coffee cremoso.","Top with bizcocho terengue."}', 1, 'ff1396ea-664c-4c80-b654-2136da431207', '2025-07-31 13:20:20.058385+00', '2025-07-31 13:33:21.480341+00', NULL);
