INSERT INTO "public"."preparations" ("preparation_id", "directions", "total_time", "fingerprint", "created_at", "updated_at", "cooking_notes", "image_updated_at", "fingerprint_plain") VALUES
	('c8200eb7-6285-42a2-af93-f50e51cf7858', '{"Schiacciare 2 spicchi di aglio.","Aggiungere 3 cucchiai di olio quando l''olio è bollente.","Aggiungere il pomodoro.","Aggiungere il basilico nel pomodoro (tritato o intero)."}', 15, 'd70a42c2-d6f2-5423-b939-40fb268750f4', '2025-07-12 13:17:52.238748+00', '2025-07-12 13:17:52.464901+00', NULL, NULL, 'basil-butter-garlic-olive-oil-tomato|schiacciare spicchi di aglio aggiungere cucchiai di olio quando l olio bollente aggiungere il pomodoro aggiungere il basilico nel pomodoro tritato o intero'),
	('e5ebfe86-99be-4a62-9468-47ea78f86e05', '{"Tightly braised green stems from leek + water.","Cook for 1 hour 30 minutes.","Pass through a sieve.","Reduce until almost dry."}', 10, 'ed565204-aba0-5c46-8a78-0fed377db79f', '2025-07-09 02:12:48.186568+00', '2025-07-19 20:10:17.486724+00', NULL, NULL, 'butter-leek|tightly braised green stems from leek water cook for hour minutes pass through a sieve reduce until almost dry'),
	('947d36b5-254d-4ef5-8888-277b9069dd9c', '{"Make a white paste of leau.","Add miso to the white paste.","Stock and poach till soft."}', 30, '45d00a1b-2fce-522d-834c-c80d4133e00a', '2025-07-23 08:16:00.12211+00', '2025-07-23 08:16:00.414998+00', NULL, NULL, 'leau-white-miso|make a white paste of leau add miso to the white paste stock and poach till soft'),
	('334f63f1-619e-4b56-bf78-fa8921ae953b', '{"Have small ''noves with a wine''.","Stock and poach till soft."}', 30, 'c387aa79-7220-5b57-bc4c-70191d71c392', '2025-07-23 14:56:12.839054+00', '2025-07-23 14:56:13.05833+00', NULL, NULL, 'leek-vegetable-stock-white-miso|have small noves with a wine stock and poach till soft'),
	('763c72bc-fdfe-4056-b811-8b70748c21f4', '{"Butter cauliflower to get a nice colour.","Add cream and cook till very soft.","Blend till smooth."}', 20, '9782b9af-0b4c-50c3-81e7-42fbba8c48d9', '2025-07-23 08:16:05.243895+00', '2025-07-23 14:56:17.33638+00', NULL, NULL, 'cauliflower-cream-unsalted-butter|butter cauliflower to get a nice colour add cream and cook till very soft blend till smooth'),
	('d5c97843-b2e2-4b7d-9332-2a239387a136', '{"Carefully separate the egg whites from the yolks.","With the electric whips, mix the yolk well first, adding half of the total amount of sugar you have until it is lighter and fluffy.","Clean your electric whips because you have to mix the egg white with the other half of the sugar.","The result will be firm, till moving up and down the bowl the cream will not move!","Gradually, spoon by spoon, add the white egg cream with the yolk cream made earlier; mix properly softly from top to bottom."}', 15, '01690e7b-616d-59c2-ad8b-b6d7058dc8dd', '2025-07-09 02:13:35.040139+00', '2025-07-09 15:40:05.546474+00', NULL, NULL, 'egg-mascarpone-cheese-sugar|carefully separate the egg whites from the yolks with the electric whips mix the yolk well first adding half of the total amount of sugar you have until it is lighter and fluffy clean your electric whips because you have to mix the egg white with the other half of the sugar the result will be firm till moving up and down the bowl the cream will not move gradually spoon by spoon add the white egg cream with the yolk cream made earlier mix properly softly from top to bottom'),
	('fa1bdca2-c244-48a5-b3ab-a1f16562677c', '{"Make a sachet d''epices with the mustard, peppercorn, and garlic.","In a pot, combine the vinegar, water, salt, chili flakes, and the sachet.","Bring to a boil, then cool down. Add dill."}', 20, 'be529f2e-149e-5768-ba79-70644bd40e71', '2025-07-24 11:08:12.264714+00', '2025-07-24 11:08:12.380529+00', NULL, NULL, 'apple-cider-vinegar-black-peppercorn-dill-garlic-red-chili-flak-salt-shallot-water-yellow-mustard-seed|make a sachet d epices with the mustard peppercorn and garlic in a pot combine the vinegar water salt chili flakes and the sachet bring to a boil then cool down add dill'),
	('b579f6f2-278e-4690-bc76-1d64e83f9eaf', '{"Heat half of the olive oil in a large frying pan over medium heat.","Add the onions and garlic, cook for 5 minutes or until onions are translucent.","Add the meat, and cook until browned.","Add the mushrooms, carrots, celery, Italian seasoning, and salt.","Continue to cook for a few minutes, until the meat is cooked through.","Remove from heat."}', 20, 'afc10898-8fc0-5825-a025-d8cbaa7b4383', '2025-07-09 15:57:47.007528+00', '2025-07-09 15:57:47.213142+00', NULL, NULL, 'carrot-celery-extra-lean-ground-turkey-extra-virgin-olive-oil-garlic-italian-seasoning-mushroom-sea-salt-yellow-onion|heat half of the olive oil in a large frying pan over medium heat add the onions and garlic cook for minutes or until onions are translucent add the meat and cook until browned add the mushrooms carrots celery italian seasoning and salt continue to cook for a few minutes until the meat is cooked through remove from heat'),
	('eba91d21-3ae0-4b0f-aae6-ed99f4d1694e', '{"Mezclar mascarpone y gelatina."}', 10, '5bcfc9e8-a544-533d-8bd5-ec350d361127', '2025-07-31 13:12:21.49503+00', '2025-07-31 13:12:21.686072+00', NULL, NULL, 'gelatina-mascarpone|mezclar mascarpone y gelatina'),
	('a9a63d8d-437a-4d5b-a580-cb4d5534b972', '{"Combine water, milk, butter, salt, and sugar in a pot.","Bring to a boil, then add flour.","Cook until the dough forms a ball.","Transfer to a mixer and add eggs gradually."}', 30, 'e604248b-3065-5508-9a59-a7b7e4cb6adc', '2025-07-31 13:20:13.497922+00', '2025-07-31 13:20:13.662381+00', NULL, NULL, 'agua-az-car-harina-huevo-leche-mantequilla-sal-fina|combine water milk butter salt and sugar in a pot bring to a boil then add flour cook until the dough forms a ball transfer to a mixer and add eggs gradually'),
	('7599c056-95fc-46b1-9e2a-162bcecb00e2', '{"Mix milk, cream, eggs, and sugar.","Add Dulcey and gelatine.",Emulsify.}', 30, '1344fb90-d1ae-598e-a686-e84ee093ca81', '2025-07-31 13:20:19.59838+00', '2025-07-31 13:20:19.735027+00', NULL, NULL, 'az-car-dulcey-gelatina-huevo-leche-nata|mix milk cream eggs and sugar add dulcey and gelatine emulsify'),
	('8b830d29-ad95-48c9-b352-296d3adaa4dc', '{"Mezclar leche y nata a 40°C.","Añadir los ingredientes secos.","Calentar a 83°C.","Añadir el sarro y el mató."}', NULL, 'e3c0b16c-c226-5e4e-8ed5-498b76e90ab3', '2025-07-10 17:03:05.45997+00', '2025-07-10 17:03:05.683047+00', NULL, NULL, 'az-car-dextrosa-estabilizante-leche-mat--nata-sal|mezclar leche y nata a c a adir los ingredientes secos calentar a c a adir el sarro y el mat'),
	('cb96a6d2-9f6b-48ab-bcef-d35f6d1a54fd', '{"Boil or steam frozen peas until tender.","Mash with butter and season with salt."}', 10, '7cc989c1-ef25-55a1-9f0c-38dc5ca8d7d6', '2025-07-11 10:53:03.44168+00', '2025-07-11 10:53:03.755775+00', NULL, NULL, 'butter-frozen-pea-salt|boil or steam frozen peas until tender mash with butter and season with salt'),
	('7522635d-6321-4529-958e-a76b9198bc14', '{"Make a white paste with the white miso.","Poach the leeks in the vegetable stock until soft."}', 20, '03476b37-72d3-5c45-b9c8-8c03652dd33f', '2025-07-09 02:12:44.498814+00', '2025-07-12 13:01:59.304203+00', NULL, NULL, 'leek-vegetable-stock-white-miso|make a white paste with the white miso poach the leeks in the vegetable stock until soft'),
	('4f74e07a-9099-43b8-8237-328da52def00', '{}', 30, '3fc19252-3e39-5f8b-a9c9-a5fcb3b634c7', '2025-07-31 13:31:53.791098+00', '2025-07-31 13:33:17.310114+00', NULL, NULL, 'az-car-gelatina-mascarpone-nata-nata-fr-a-vainilla|'),
	('ea042b8b-de67-47b6-9772-8317e43e3947', '{"Fry the aubergines and onions until caramelised.","Separate from the pan.","Fry red pepper - separate.","Fry courgette until all the water has gone - should be browned.","Bring everything together in the same pan, add herbs and cook with tomato puree."}', 20, 'e0a5aba8-9b44-537f-97ab-efb54ba321c0', '2025-07-16 15:59:44.798493+00', '2025-07-16 15:59:45.005746+00', NULL, NULL, 'aubergine-courgette-herb-onion-red-pepper-tomato-puree|fry the aubergines and onions until caramelised separate from the pan fry red pepper separate fry courgette until all the water has gone should be browned bring everything together in the same pan add herbs and cook with tomato puree'),
	('4bc9f164-9169-4b0a-bacb-3af5f5c34f27', '{"Butter cauliflower to get a nice colour.","Add cream and cook till very soft.","Blend till smooth."}', 15, 'ec3673b5-a741-5fc3-b943-c987a0f0d31c', '2025-07-09 02:12:46.597607+00', '2025-07-19 20:10:18.623115+00', NULL, NULL, 'butter-cauliflower-cream|butter cauliflower to get a nice colour add cream and cook till very soft blend till smooth'),
	('214ea2d4-b92a-4b78-af05-7e09f66f5461', '{"Prepare 4 full cups of coffee."}', 5, 'e3bf2e5f-9c11-5806-8aaf-2246f57bec87', '2025-07-09 02:13:36.750239+00', '2025-07-09 02:13:37.031416+00', NULL, NULL, 'coffee|prepare full cups of coffee'),
	('b6d6ed01-5ecf-4864-957c-0e6c94d05efa', '{"Tightly braise the green stems of leau with water.","Cook for 1 hour and 30 minutes.","Pass through a sieve.","Reduce the liquid to desired consistency."}', 90, '6cebd0f7-4e4d-522f-ab44-1c9e2f83d675', '2025-07-23 08:16:02.726433+00', '2025-07-23 08:16:02.906664+00', NULL, NULL, 'leau-unsalted-butter-water|tightly braise the green stems of leau with water cook for hour and minutes pass through a sieve reduce the liquid to desired consistency'),
	('8e48673c-62f8-4eff-b79b-b69c81b45fe9', '{"Smash the cucumber with a rolling pin but don''t pulverise it.","Slice off the ends off the cucumber and discard.","Cut the cucumber into quarters lengthways and slice into 2-3cm chunks.","Place in a bowl and add the remaining ingredients except the coriander and mix well."}', 20, 'e8a6e9f5-b9f3-561d-8345-4b8a98c79334', '2025-07-23 08:18:15.383097+00', '2025-07-23 08:18:15.636212+00', NULL, NULL, 'chilli-cucumber-garlic-rice-wine-vinegar-sesame-oil-sugar-unsalted-butter|smash the cucumber with a rolling pin but don t pulverise it slice off the ends off the cucumber and discard cut the cucumber into quarters lengthways and slice into cm chunks place in a bowl and add the remaining ingredients except the coriander and mix well'),
	('436e84a1-b015-4d80-8099-101f9a568a72', '{"Place cauliflower florets in a medium-sized saucepan, cover with water, and bring to a boil.","Let the florets boil until they are soft, about 15 minutes.","Drain the cauliflower and discard cooking water.","Return the cauliflower to the pot and add the other half of the olive oil and a sprinkle of salt.","Mash well until the cauliflower becomes almost like a puree."}', 15, '1dc54cb0-e5a7-509c-a9e7-183ab62b7b22', '2025-07-09 15:57:49.463461+00', '2025-07-09 17:58:46.23313+00', NULL, NULL, 'cauliflower-extra-virgin-olive-oil-sea-salt|place cauliflower florets in a medium sized saucepan cover with water and bring to a boil let the florets boil until they are soft about minutes drain the cauliflower and discard cooking water return the cauliflower to the pot and add the other half of the olive oil and a sprinkle of salt mash well until the cauliflower becomes almost like a puree'),
	('b4048a40-484e-4156-b78f-9b100544afd5', '{"Tightly braised green stems from leek + water.","Cook for 1 hour 30 minutes.","Pass through a sieve.","Reduce until almost dry."}', 60, '3a9b9ce1-afea-5d50-827f-3d4229955e29', '2025-07-23 14:56:16.435945+00', '2025-07-23 14:56:16.629214+00', NULL, NULL, 'butter-leek-water|tightly braised green stems from leek water cook for hour minutes pass through a sieve reduce until almost dry'),
	('936b3fe1-8afa-42b8-b44a-17a9bd4c429d', '{"Cut fish fillets into stick shapes.","Dredge fish sticks in flour, then dip in beaten eggs, and coat with breadcrumbs.","Fry until golden and crispy."}', 15, '789b6abe-8390-5aa8-8a45-41572b0fcbe2', '2025-07-11 10:52:58.193985+00', '2025-07-11 10:52:58.382859+00', NULL, NULL, 'breadcrumb-egg-fish-fillet-flour-pepper-salt|cut fish fillets into stick shapes dredge fish sticks in flour then dip in beaten eggs and coat with breadcrumbs fry until golden and crispy'),
	('a6bebce6-5875-46b5-afa1-38f8dcad5932', '{"Roll out the puff pastry.","Top with cherry tomatoes, drizzle with olive oil and balsamic vinegar.","Sprinkle with Italian spice mix.","Bake in the oven for 15 minutes at 180 degrees.","Top with burrata and basil."}', 15, '933b37a2-b833-5edd-9827-94b6f4e1f5c5', '2025-07-11 18:42:54.159127+00', '2025-07-11 18:42:54.355815+00', NULL, NULL, 'aceite-de-oliva-aplastado-o-hojaladre-basilica-burrata-mezcla-de-especias-italiana-tomates-ceris-vinagre-bals-mico|roll out the puff pastry top with cherry tomatoes drizzle with olive oil and balsamic vinegar sprinkle with italian spice mix bake in the oven for minutes at degrees top with burrata and basil'),
	('cf03a865-782a-43bf-a7ed-fdf339aef463', '{"Blend all ingredients until smooth."}', 5, '85bf97fe-6e5b-5808-8ca1-ac7876eb2c52', '2025-07-24 11:23:48.251234+00', '2025-07-24 11:23:48.332752+00', NULL, NULL, 'doenjang-garlic-gochujang-jalape-o-rice-vinegar-scallion-sesame-oil-soy-sauce-sugar|blend all ingredients until smooth'),
	('03b059cf-caf7-413e-9313-a52e546f2908', '{"Mezclar nata y azúcar."}', 5, '9de3cf1a-1ce0-5f9c-84a6-7e56ade1bfaa', '2025-07-31 13:12:23.470613+00', '2025-07-31 13:12:23.625301+00', NULL, NULL, 'az-car-nata|mezclar nata y az car'),
	('0688ba42-e321-42b1-a29e-78a38ce7825f', '{"Mix curd, sugar, and egg yolks.","Add dry ingredients and mix.","Bake at 180°C."}', 20, 'e5d67543-9842-58f5-9e0f-d71d5418b252', '2025-07-31 13:20:16.661021+00', '2025-07-31 13:20:16.814715+00', NULL, NULL, 'az-car-cuajada-harina-maizena-yema-de-huevo|mix curd sugar and egg yolks add dry ingredients and mix bake at c'),
	('096fce76-eb2a-4fca-a30e-466e90c7347c', '{"Tightly bundle leek greens.","Boil in water for 1-1.5 hours.","Pass through a sieve.","Reduce remaining stock to desired consistency."}', 10, '7a09276d-0c9b-5335-b3a0-bad57232d47f', '2025-08-01 13:22:04.510654+00', '2025-08-01 13:22:04.711709+00', NULL, NULL, 'leek-green-water|tightly bundle leek greens boil in water for hours pass through a sieve reduce remaining stock to desired consistency');
